    /** Creates a new instance of Trail.
     * Calling initGEtrail with 600 */
    public LosAltosTrail() {
        initGEtrail(2000);
	_working_trail = new int[_trail_la.length][_trail_la[0].length];
	for(int i = 0; i< _trail_la.length; i++) {
	    for(int j = 0; j< _trail_la[i].length; j++) {
		_working_trail[i][j] = _trail_la[i][j];
	    }
	} 
    }

    /**
     * Create new instance
     * @param energy ant stamina
     */
    public LosAltosTrail(int energy) {
        initGEtrail(energy);
        _working_trail = new int[_trail_la.length][_trail_la[0].length];
	for(int i = 0; i< _trail_la.length; i++) {
	    for(int j = 0; j< _trail_la[i].length; j++) {
		_working_trail[i][j] = _trail_la[i][j];
	    }
	} 
    }

    /**
     * Initiate the trail
     * @param e energy for the trail
     */
    void initGEtrail(int e){
        _current_X=0;
        _current_Y=0;
        _facing_current_X=0;
        _facing_current_Y=1;
        _energy = e;
        _picked_up = 0;
        food = 157;
    }

    /**
     * Read a trail from file
     * @param file_name name of file
     */
    @SuppressWarnings({"ConstantConditions", "IOResourceOpenedButNotSafelyClosed"})
    void readTrailGEtrail(String file_name) {
        int y = 0;
        int x;
        char ch;
        int bufferSize = 1024;
        String line;
        try {
            FileReader fr = new FileReader(file_name);
            BufferedReader br = new BufferedReader(fr, bufferSize);
            while ((line = br.readLine()) != null) {
                if (!line.startsWith("#")) {
                    for (x = 0; x < line.length(); x++) {
                        ch = line.charAt(x);
                        if (ch == '.' || ch == '0') {
                            _trail_la[x][y] = EMPTY;
                            _working_trail[x][y] = EMPTY;
                        } else if (ch == '1') {
                            _trail_la[x][y] = FOOD;
                            _working_trail[x][y] = FOOD;
                        }
                    }
                    y++;
                }
            }
            if (br != null) {
                br.close();
            }
        } catch (FileNotFoundException e) {
            System.err.println("File not found: " + file_name);
        } catch (IOException e) {
            System.err.println("IOException: " + file_name);
        }

        for (food = 0, y = 0; y < GRID_HEIGHT; y++) {
            for (x = 0; x < GRID_WIDTH; x++) {
                if (_trail_la[x][y] == FOOD) {
                    food++;
                }
            }
        }
    }
